import React, { Component } from 'react';
import {  Route } from "react-router";
import LastPage from './view/last';

class App extends Component {
  render() {
    return (
      <div className="App" id='root'>
        <div>
          <a href="/last">About</a>
        </div>
        <Route path="/last" component={LastPage} />
      </div>
    );
  }
}

export default App;
